MorePastPapers;

import Link from "next/link";

const MorePastPapers = props => (
  <div className="box">
    <h1 className="title is-5">More Past Papers</h1>
    <p>
      Check out and download our free catalogue of CSCE and CAPE past paper
      booklets for other subjects,
      <span className="has-text-danger">not just for Spanish!</span>
    </p>
  </div>
);

export default MorePastPapers;
